import React from "react";

import { teamData } from "../data";

import { motion } from "framer-motion";

import { fadeIn } from "../variants";

const Team = () => {
  const {
    pretitle,
    title,
    sub1,
    sub2,
    name,
    occupationImg,
    signatureImg,
    chefImg,
  } = teamData;
  return (
    <section className=" bg-pink-300 relative top-96 z-10">
      Team
    </section>
  );
};

export default Team;
